import React from 'react';
import { Card, Row, Col, Container } from 'react-bootstrap';
import '../courses/courses.styles.css';

const CourseContent = (image) => (
    <Container>
        <Row>
            {console.log(image.image.id)}
            <Col>
                <Card  key={image.id} style={{ width: '18rem' }} className="card">
                    <Card.Img variant="top" src={image.name}/>
                    <Card.Body>
                        <span className="title">{image.title}</span>
                    </Card.Body>
                </Card>   
            </Col>                     
        </Row>
    </Container>
)
export default CourseContent;
